DROP TABLE IF EXISTS movies;
DROP TABLE IF EXISTS ratings;
DROP TABLE IF EXISTS tags;
DROP TABLE IF EXISTS users;
CREATE TABLE IF NOT EXISTS movies (id INTEGER PRIMARY KEY, title varchar(255), year varchar(255), genres varchar(255));
CREATE TABLE IF NOT EXISTS ratings (id INTEGER PRIMARY KEY, user_id INT, movie_id INT, raiting FLOAT, timestamp TIMESTAMP);
CREATE TABLE IF NOT EXISTS tags (id INTEGER PRIMARY KEY, user_id INT, movie_id INT, tag varchar(255), timestamp TIMESTAMP);
CREATE TABLE IF NOT EXISTS users (id INTEGER PRIMARY KEY, name varchar(255), email varchar(255), gender varchar(255), register_date DATE, occupation varchar(255));
